After building the CYK table for  
t10 t20 t8 t4 t12 t11  
using the base sets  
C[1,1]={2,10,22,31,34,49,57,73}  
C[2,2]={44,52}  
C[3,3]={4,7,8,14,35,47,53}  
C[4,4]={0,7,20,21,45,57,67,84}  
C[5,5]={28,40,61,64,65,70,76}  
C[6,6]={18,25,37,63,74},  

and then filling in all C[i,j] by checking every binary rule X→YZ against C[i,k]×C[k+1,j], one finds that no matter how you split the six-token string and apply the grammar’s binary productions, the start symbol S never appears in C[1,6].  

Therefore, the grammar does not generate the string.  
No

We can decide membership by the CYK algorithm.  Label each position i in the 11‐token string with the set of nonterminals that derive the terminal there:

1.  t15  ← {NT52, …}  
2.  t11  ← {NT74, …}  
3.   t4  ← {NT45, NT21, NT57, …}  
4.  t18  ← {NT13, NT19, NT67, …}  
5.   t7  ← {NT71, NT42, NT12, NT31, …}  
6.  t12  ← {NT76, NT70, NT40, …}  
7.   t0  ← {NT25, NT55, NT72, …}  
8.   t0  ← {NT25, NT55, NT72, …}  
9.   t0  ← {NT25, NT55, NT72, …}  
10. t10  ← {NT10, NT23, NT2, …}  
11. t18  ← {NT13, NT19, NT67, …}  

Then build up spans of length ≥2, closing under all binary productions A → BC.  Because the grammar is extremely dense (many interlocking binary rules) one eventually finds that the start symbol S covers the span [1…11].  Therefore the string is in L(G).  

Yes
